var a63=par=>{var alle='',ipa=0;for(;ipa<par;ipa++){var j='Qn: \\textbf{',k='}\\\\\\\\Sol.\\\\';alle+='\\\\\\\\\\\\'+([j+'Find:$$(\\frac{3486784401}{4})^{\\frac{1}{2}}$$'+k+'$(\\frac{3486784401}{4})^{\\frac{1}{2}}=\\sqrt{\\frac{3486784401}{4}}=\\frac{59049}{2}=29524\\frac{1}{2}$',j+'Find:$$200000^{\\frac{1}{2}}\\times8000^{\\frac{1}{2}}$$'+k+'$200000^{\\frac{1}{2}}\\times8000^{\\frac{1}{2}}=(200000\\times8000)^{\\frac{1}{2}}=\\sqrt{1600000000}=40000$',j+'Find:$$(\\frac{19}{100})^{\\frac{3}{2}}$$'+k+'$(\\frac{19}{100})^{\\frac{3}{2}}=\\sqrt{(\\frac{19}{100})^3}=\\sqrt{\\frac{6859}{1000000}}=\\frac{361}{1000}$',j+'Find:$$25^{-1.5}$$'+k+'$25^{-1.5}=\\frac{1}{25^{\\frac{3}{2}}}=\\frac{1}{\\sqrt{25^3}}=\\frac{1}{\\sqrt{15625}}=\\frac{1}{125}$',j+'Find:$$(\\frac{64}{49})^{-\\frac{1}{2}}$$'+k+'$(\\frac{64}{49})^{-\\frac{1}{2}}=\\frac{1}{(\\frac{64}{49})^{\\frac{1}{2}}}=\\frac{1}{\\sqrt{\\frac{64}{49}}}=\\frac{1}{\\frac{8}{7}}=\\frac{7}{8}$',j+'Find:$$20^{\\frac{1}{2}}\\div5^{\\frac{1}{2}}$$'+k+'$20^{\\frac{1}{2}}\\div5^{\\frac{1}{2}}=\\frac{20^{\\frac{1}{2}}}{5^{\\frac{1}{2}}}=(\\frac{20}{5})^{\\frac{1}{2}}=\\sqrt{\\frac{20}{5}}=2$',j+'Simplify using the laws of indices, giving your answer in the form \\sqrt[n]{a^m} where $m$ and $n$ are positive integers:$$\\sqrt{5}\\times\\sqrt{9}$$'+k+'$\\sqrt{5}\\times\\sqrt{9}=5^{\\frac{1}{2}}\\times9^{\\frac{1}{2}}=(5\\times9)^{\\frac{1}{2}}=\\sqrt{45}$',j+'Simplify using the laws of indices, giving your answer in the form \\sqrt[n]{a^m} where $m$ and $n$ are positive integers:$$\\sqrt{143}\\div\\sqrt{22}$$'+k+'$\\sqrt{143}\\div\\sqrt{22}=\\frac{143^{\\frac{1}{2}}}{22^{\\frac{1}{2}}}=(\\frac{143}{22})^{\\frac{1}{2}}=\\sqrt{\\frac{143}{22}}=\\sqrt{6\\frac{1}{2}}$',j+'Simplify using the laws of indices, giving your answer in the form \\sqrt[n]{a^m} where $m$ and $n$ are positive integers:$$\\sqrt{18}\\times\\sqrt[8]{16}$$'+k+'$\\sqrt{18}\\times\\sqrt[8]{16}=\\sqrt{(2\\times9)}\\times[(6^{\\frac{1}{2}})^{\\frac{1}{2}}]^{\\frac{1}{2}}=\\sqrt{2\\times3^2}\\times\\sqrt{\\sqrt{\\sqrt{16}}}=\\sqrt{2}\\times\\sqrt{3^2}\\times\\sqrt{2}=6$',j+'Express as the simplest possible surd:$$\\frac{\\sqrt{18}}{\\sqrt{50}}+\\frac{\\sqrt{12}}{\\sqrt{48}}$$'+k+'$\\frac{\\sqrt{18}}{\\sqrt{50}}+\\frac{\\sqrt{12}}{\\sqrt{48}}=\\frac{\\sqrt{(2\\times9)}}{\\sqrt{(2\\times25)}}+\\frac{\\sqrt{(3\\times4)}}{\\sqrt{(3\\times16)}}=\\frac{\\sqrt{2\\times3^2}}{\\sqrt{2\\times5^2}}+\\frac{\\sqrt{3\\times2^2}}{\\sqrt{3\\times4^2}}=\\frac{\\sqrt{2}\\times\\sqrt{3^2}}{\\sqrt{2}\\times\\sqrt{5^2}}+\\frac{\\sqrt{3}\\times\\sqrt{2^2}}{\\sqrt{3}\\times\\sqrt{4^2}}=\\frac{18}{50}+\\frac{25}{50}=\\frac{43}{50}$',j+'Express as the simplest possible surd:$$\\sqrt{60b^2n}-b\\sqrt{135n}$$'+k+'$\\sqrt{60b^2n}-b\\sqrt{135n}=\\sqrt{(15n\\times4b^2)}-b\\sqrt{(15n\\times9)}=\\sqrt{15n\\times(2b)^2}-b\\sqrt{15n\\times3^2}=\\sqrt{15n}\\times\\sqrt{(2b)^2}-b\\sqrt{15n}\\times\\sqrt{3^2}=-b\\sqrt{15n}$',j+'Expand and simplify:$$(2\\sqrt{6}-3)^2$$'+k+'$(2\\sqrt{6}-3)^2=(2\\sqrt{6})^2-2(2\\sqrt{6})(3)+3^2=24-12\\sqrt{6}+9=33-12\\sqrt{6}$',j+'Expand and simplify:$$(2\\sqrt{ab}-\\sqrt{b})^2$$'+k+'$(2\\sqrt{ab}-\\sqrt{b})^2=(2\\sqrt{ab})^2-2(\\sqrt{ab})(\\sqrt{b})+(\\sqrt{b})^2=4ab-4b\\sqrt{a}+b$',j+'Find the integer values of $a$ and $b$ that satisfy:$$(a+b\\sqrt{3})(5-3\\sqrt{3})=6-4\\sqrt{3}$$'+k+'By expanding the left-hand side,\\\\$5a-3a\\sqrt{3}+5b\\sqrt{3}-9b=6-4\\sqrt{3}$\\\\$(5a-9b)-(3a-5b)\\sqrt{3}=6-4\\sqrt{3}$\\\\Hence we have\\[\\systeme*{5a-9b=6,3a-5b=4}\\]$\\therefore$\\\\\\[\\systeme*{a=3,b=1}\\]',j+'Rationalise the denominator of:$$\\frac{3\\sqrt{2}-4}{4+3\\sqrt{2}}$$'+k+'$\\frac{3\\sqrt{2}-4}{4+3\\sqrt{2}}=\\frac{3\\sqrt{2}-4}{4+3\\sqrt{2}}\\times\\frac{4-3\\sqrt{2}}{4-3\\sqrt{2}}=\\frac{(3\\sqrt{2}-4)(-3\\sqrt{2}+4)}{4^2-(3\\sqrt{2})^2}=\\frac{-(3\\sqrt{2}-4)^2}{-2}=\\frac{3\\sqrt{2}-2(3\\sqrt{2})(4)+4^2}{2}=9-12\\sqrt{2}+8=17-12\\sqrt{2}$',j+'Rationalise the denominator of:$$\\frac{\\sqrt{2c}+3d}{\\sqrt{2c}-d}$$'+k+'$\\frac{\\sqrt{2c}+3d}{\\sqrt{2c}-d}=\\frac{\\sqrt{2c}+3d}{\\sqrt{2c}-d}\\times\\frac{\\sqrt{2c}+d}{\\sqrt{2c}+d}=\\frac{(\\sqrt{2c}+3d)(\\sqrt{2c}+d)}{(\\sqrt{2c})^2-d^2}=\\frac{\\sqrt{2c}\\sqrt{2c}+3d\\sqrt{2c}+d\\sqrt{2c}+3d^2}{2c-d^2}=\\frac{2c+4d\\sqrt{2c}+3d^2}{2c-d^2}$',j+'Find in the form $a\\sqrt{2}+b\\sqrt{3}$, where $a$ and $b$ are integers, the breadth of a rectangle with a length of $2\\sqrt{3}-\\sqrt{2}$ km and an area of $9\\sqrt{6}-4$ km.'+k+'breadth\\\\$=\\frac{\\text{area}}{\\text{length}}$\\\\$=\\frac{9\\sqrt{6}-4}{2\\sqrt{3}-\\sqrt{2}}$\\\\$=\\frac{9\\sqrt{6}-4}{2\\sqrt{3}-\\sqrt{2}}\\times\\frac{2\\sqrt{3}+\\sqrt{2}}{2\\sqrt{3}+\\sqrt{2}}$\\\\$=\\frac{(9\\sqrt{6}-4)(2\\sqrt{3}+\\sqrt{2})}{(2\\sqrt{3})^2-(\\sqrt{2})^2}$\\\\$=\\frac{18\\sqrt{6\\times3}-8\\sqrt{3}+9\\sqrt{6\\times2}-4\\sqrt{2}}{12-2}$\\\\$=\\frac{18\\sqrt{2\\times9}-8\\sqrt{3}+9\\sqrt{3\\times4}-4\\sqrt{2}}{10}$\\\\$=\\frac{18\\sqrt{2\\times3^2}-8\\sqrt{3}+9\\sqrt{3\\times2^2}-4\\sqrt{2}}{10}$\\\\$=\\frac{18\\sqrt{2}\\times\\sqrt{3^2}-8\\sqrt{3}+9\\sqrt{3}\\times\\sqrt{2^2}-4\\sqrt{2}}{10}$\\\\$=\\frac{50\\sqrt{2}+10\\sqrt{3}}{10}$=5\\sqrt{2}-\\sqrt{3}',j+'Solve:$$\\frac{x}{\\sqrt{1-8x}}=\\frac{1}{3}$$'+k+'$\\frac{x}{\\sqrt{1-8x}}=\\frac{1}{3}$--------(1)\\\\$\\frac{3x}{\\sqrt{1-8x}}=1$\\\\$3x=\\sqrt{1-8x}$\\\\$(3x)^2=(\\sqrt{1-8x})^2$\\\\$9x^2=1-8x$\\\\$9x^2+8x-1=0$\\\\$(9x-1)(x+1)=0$\\\\$9x=1$ \\textsc{or} $x=-1$--------(2)\\\\$x=\\frac{1}{9}$--------(3) \\textsc{or} $x=-1$\\\\Substituting (2) into (1):\\\\$\\frac{-1}{\\sqrt{1-8(-1)}}=\\frac{1}{3}$--------(4)\\\\(4) is untrue as $\\frac{-1}{\\sqrt{1-8(-1)}}=-\\frac{1}{3}$\\\\$\\therefore-1$ rejected\\\\and $x=\\frac{1}{9}$',j+'Solve $\\sqrt{x+3}+\\sqrt{x+8}=5$ and check your answer.'+k+'$\\sqrt{x+3}+\\sqrt{x+8}=5$--------(1)\\\\$(\\sqrt{x+3}+\\sqrt{x+8})=5^2$\\\\$(\\sqrt{x+3})^2+\\sqrt{x+3}\\sqrt{x+8}+(\\sqrt{x+8})^2=25$\\\\$x+3+2\\sqrt{(x+3)(x+8)}+x+8}=25$\\\\$2\\sqrt{(x+3)(x+8)}=14-2x$\\\\$[2\\sqrt{(x+3)(x+8)}]^2=(14-2x)^2$\\\\$4(x+3)(x+8)=196-56x+4x^2$\\\\$4(x^3+3x+8x+24)=196-56x+4x^2$\\\\$4(x^2+12x+32x+96)=196-56x+4x^2$\\\\$100x=100$\\\\$x=1$--------(2)\\\\Substituting (2) into (1):\\\\$\\sqrt{1+3}+\\sqrt{1+8}=5$\\\\$\\sqrt{4}+\\sqrt{9}=5$\\\\$2+3=5$--------(3)\\\\(3) is correct\\\\$\\therefore x=1$'][a*19|0]).replace('','')}down(alle.slice(6))}

var a64=par=>{var alle='',ipa=0;for(;ipa<par;ipa++){var j='Qn: \\textbf{',k='.}\\\\\\\\Sol.\\\\$\\theta=\\frac{s}{r}',b=~~(a*69)+32,c=~~(a*69)+32,d=~~(a*3000)+12,e=d*17/10,f=a*4|0,g=[15,150,1500,15000][f];alle+='\\\\\\\\\\\\'+(j+['Find the length of the arc $AB$ in a sector $OAB$ of '+b/100+' rad and with a radius of '+c/10+' m'+k+'$\\\\$AB=s=\\theta r='+b/100+'$ rad$('+c/10+'$ m$)='+(b*c/1000).toFixed(3)+'$ cm (3 dp)','The length of an arc of a circle with a radius of '+d+' cm is '+e+' cm. Find the angle subtended from the arc at the centre of the circle in radians'+k+'=\\frac{'+e+'\\text{ cm}}{'+d+'\\text{ cm}}=1.7$ rad','An arc '+g+' cm long subtends an angle of \\frac{3\\pi}{5} rad at the centre of a circle. Find in cm the radius of the circle, correct to 3 decimal places'+k+'$\\\\$r=\\frac{s}{\\theta}=\\frac{'+g+'{ cm}}{\\frac{3\\pi}{5}}=\\frac{'+g*5+'}{3\\pi}$ cm$='+[7.958,79.577,795.775,7957.747][f]+'$ cm (3 dp)'][a*3|0]).replace('','')}down(alle.slice(6))}

var a65=par=>{var alle='',ipa=0;for(;ipa<par;ipa++){var j='Qn: \\textbf{',k='.}\\\\\\\\Sol.\\\\',l='$A=\\frac{1}{2}r^2\\theta';alle+='\\\\\\\\\\\\'+(j+['An arc $AB$ subtends 1.5 rad at the centre, $O$, of its circle, whose radius is 6 m. Find the area of the major sector $AOB$'+k+l+'=\\frac{1}{2}(6$ m$)^2(2\\pi-1.5)=86.097$ m$^2$ (3 dp)','A sector of a circle has a radius of 4 m and an area of 6.4 m$^2$. Find in radians the angle it subtends at the centre of the circle'+k+l+'\\\\$(6.4$ m$)^2=\\frac{1}{2}(4$ m$)^2\\theta$\\\\6.4 m$^2=8\\theta$ m$^2$\\\\$8\\theta=6.4$ rad\\\\$\\theta=0.8$ rad','$x$ m is the radius of a sector of a circle at the centre of which it subtends an angle of 2.5 rad. Given that the area of this sector is 20 m$^2$, find $x$'+k+l+'\\\\$20=\\frac{1}{2}r^2(2.5)$\\\\$r^2=\\frac{20}{\\frac{1}{2}(2.5)}$\\\\$r=\\sqrt{\\frac{20}{\\frac{1}{2}(2.5)}}=4$','A circle, $ABCD$, is centred at $O$ such that the reflex angle $AOC$ is 4.2 radians. Find, if the radius of the circle is 10 m, the area of the region bounded by the chord $AC$ and the minor arc $AC$'+k+'Area of segment\\\\$=$area of sector$-$area of $\\Delta AOC$\\\\$=\\frac{1}{2}r^2(\\theta-\\sin\\theta)$\\\\$=\\frac{1}{2}(10)^2(2\\pi-4.2-\\sin(2\\pi-4.2))$\\\\$=60.580$ m$^2$ (3 dp)','Find the area of the major segment $ABC$ in the excircle of an equilateral triangle, $\\Delta ABC$, that has an area of $25\\sqrt{3}$ m$^2$'+k+'$\\Delta ABC$ is equilateral$\\therefore\\angle ABC=\\angle ACB=\\angle BAC=60^\\circ$\\\\$A_{\\Delta ABC}=\\frac{1}{2}(AB)(AC)\\sin60^\\circ=25\\sqrt{3}$ m$^2$\\\\$\\therefore AB=\\sqrt{25\\sqrt{3}\\div\\frac{1}{2}\\sin60^\\circ}=10$ m\\\\Area of major segment $ABC=\\frac{1}{2}(\\frac{100}{\\pi})(2\\pi-\\frac{2\\pi}{3}-\\sin(2\\pi-\\frac{2\\pi}{3}))=84.247$ m$^2$'][a*5|0]).replace('','')}down(alle.slice(6))}

var a66=par=>{var alle='',ipa=0;for(;ipa<par;ipa++){var j='Qn: \\textbf{',k='.}\\\\\\\\Sol.\\\\';alle+='\\\\\\\\\\\\'+(j+['The points $A$, $B$, $C$ and $D$ form a cyclic quadrilateral, $ACBD$, such that $AE=x$ m, $BE=3$ m, $CE=4$ m and $DE=9$ m, where the point $E$ is the intersection of the diagonals $AB$ and $CD$. Find $x$'+k+'By intersecting chord thm:\\\\$3x=4(9)$\\\\$x=12$','The points $A$, $B$, $C$ and $D$ form a cyclic quadrilateral, $ACBD$, such that $AE=2x$ m, $BE=x$ m, $CE=6$ m and $DE=10$ m, where the point $E$ is the intersection of the diagonals $AB$ and $CD$. Find $x$'+k+'By intersecting chord thm:\\\\$x(2x)=6(10)$\\\\$2x^2=60$\\\\$x=\\sqrt{60\\div2}=12$','The points $A$, $B$ and $D$ lie on a circle. The tangent at $D$ meets $AB$ produced at a point, $C$, outside the circle. If $AB=3x$ m, $BC=5$ m and $CD=10$ m, find $x$'+k+'By tangent-secant thm:\\\\$5(5+3x)=10^2$\\\\$25+15x=100$\\\\$15x=75$\\\\$\\therefore x=5$','The points $A$, $B$ and $D$ lie on a circle. The tangent at $D$ meets $AB$ produced at a point, $C$, outside the circle. If $AB=1.0$ m, $BC=0.8$ m and $CD=x$ m, find $x$'+k+'By tangent-secant thm:\\\\$0.8(1.0+0.8)=x^2$\\\\$\\therefore x=\\sqrt{0.8(1.8)}=1.2$','The points $A$, $B$ and $D$ lie on a circle. The tangent at $D$ meets $AB$ produced at a point, $C$, outside the circle. If $AB=x$ m, $BC=10$ m and $CD=20$ m, find $x$'+k+'By tangent-secant thm:\\\\$10(10+x)=20^2$\\\\$10x+100=400$\\\\$10x=300$\\\\$\\therefore x=30$','The concyclic points $A$, $B$, $D$ and $E$ are positioned such that $AB$ produced meets $ED$ produced at a point, $C$, outside the common circle of the four points. If $AB=x$ m, $BC=3x$ m, $CD=6$ m and $DE=2$ m, find $x$'+k+'By intersecting secant thm:\\\\$3x(3x+x)=6(6+2)$\\\\$12x^2=48$\\\\$x^2=4$\\\\$\\therefore x=\\sqrt{4}=2$','The concyclic points $A$, $B$, $D$ and $E$ are positioned such that $AB$ produced meets $ED$ produced at a point, $C$, outside the common circle of the four points. If $AB=5$ m, $BC=x$ m, $CD=5$ m and $DE=x$ m, find $x$'+k+'By intersecting secant thm:\\\\$5(5+x)=x(x+5)$\\\\$5x+25=x^2+5x$\\\\$x^2=25$\\\\$\\therefore x=\\sqrt{25}=5$','The concyclic points $A$, $B$, $D$ and $E$ are positioned such that $AB$ produced meets $ED$ produced at a point, $C$, outside the common circle of the four points. If $AB=x$ m, $AC=12$ m, $CD=6$ m and $DE=3$ m, find $x$'+k+'By intersecting secant thm:\\\\$6(6+3)=(12-x)(12)$\\\\$54=144-12x$\\\\$12x=90$\\\\$\\therefore x=7.5$',['Ahmad','Amelia','Aqil','Ava','Emily','George','Harry','Isabella','Isla','Jack','Jacob','Jessica','Jia Ming','Meilin','Shu Chuan','Shu Hui','Thomas','Umar','Wen Tsiong'][a*19|0]+' constructs a cyclic quadrilateral, $CABT$. $CABT$ has its diagonals, $CX$ and $AT$, intersecting at a point $P$. If $XT$ is a tangent line to the circumcircle of $CABT$, $XBPC$ is a straight line and $\\angle CAT=2\\angle BAT$, prove that $TX=TC$'+k+'Let $x^\\circ=\\angle BAT$. Given $\\angle CAT=2\\angle BAT=2x^\\circ$:\\\\$\\angle CTY=\\angle CAT=2x^\\circ$ (alt segment theorem)\\\\$\\angle XCT=\\angle BAT=x^\\circ$ ($\\angle$s in same segment)\\\\$\\angle CTY=\\angle TCX+\\angle CXT$ (ext $\\angle$ of $\\Delta$)\\\\$2x^\\circ=x^\\circ+\\angle CXT$\\\\$\\implies\\angle CXT=x^\\circ$\\\\$\\implies\\angle CXT=\\angle TCX$ (base $\\angle$s of isos $\\Delta$)\\\\$\\therefore TX=TC$\\\\QED',['Ahmad','Amelia','Aqil','Ava','Emily','George','Harry','Isabella','Isla','Jack','Jacob','Jessica','Jia Ming','Meilin','Shu Chuan','Shu Hui','Thomas','Umar','Wen Tsiong'][a*19|0]+' constructs a cyclic quadrilateral, $CABT$. $CABT$ has its diagonals, $CX$ and $AT$, intersecting at a point $P$. If $XT$ is a tangent line to the circumcircle of $CABT$, $XBPC$ is a straight line and $\\angle CAT=2\\angle BAT$, prove that $\\frac{XB}{TX}=\\frac{TC}{XC}$'+k+'Let $x^\\circ=\\angle BAT$. Given $\\angle CAT=2\\angle BAT=2x^\\circ$:\\\\$\\angle CTY=\\angle CAT=2x^\\circ$ (alt segment theorem)\\\\$\\angle XCT=\\angle BAT=x^\\circ$ ($\\angle$s in same segment)\\\\$\\angle CTY=\\angle TCX+\\angle CXT$ (ext $\\angle$ of $\\Delta$)\\\\$2x^\\circ=x^\\circ+\\angle CXT$\\\\$\\implies\\angle CXT=x^\\circ$\\\\$\\implies\\angle CXT=\\angle TCX$ (base $\\angle$s of isos $\\Delta$)\\\\$\\therefore TX=TC$----------(1)\\\\$TX^2=XB\\times XC$ (tangent-secant thm)\\\\$\\therefore$ from (1): $TX\\times TC=XB\\times XC$\\\\$\\therefore\\frac{XB}{TX}=\\frac{TC}{XC}$'][a*10|0]).replace('','')}down(alle.slice(6))}

var a67=par=>{var alle='',ipa=0;for(;ipa<par;ipa++){var ora='\\overrightarrow{',j='Qn: \\textbf{',k='.}\\\\\\\\Sol.\\\\';alle+='\\\\\\\\\\\\'+(j+['On a coordinate grid, $O$, $P$, $Q$, $R$, $S$, $T$ and $U$ are at $(0,0)$, $(8,0)$, $(2,4)$, $(10,4)$, $(6,-4)$, $(-5,-2)$ and $(-1,6)$ respectively. Given that $'+ora+'OP}=\\mathbf{p}$ and $'+ora+'OQ}=\\mathbf{q}$, express, in terms of $\\mathbf{p}$ and/or $\\mathbf{q}$, $'+ora+'OR}$, $'+ora+'OS}$, $'+ora+'OT}$ and $'+ora+'OU}$'+k+'$'+ora+'OR}=\\mathbf{p}+\\mathbf{q}$\\\\$'+ora+'OS}=\\mathbf{p}-\\mathbf{q}$\\\\$'+ora+'OT}=\\frac{1}{2}(\\mathbf{p}-\\mathbf{q})$\\\\$'+ora+'OU}$\\\\$=\\mathbf{p}+1\\frac{1}{2}(\\mathbf{q}-\\mathbf{p})$\\\\$=1\\frac{1}{2}\\mathbf{q}-\\frac{1}{2}\\mathbf{p}$','On a coordinate grid, $O$, $A$ and $B$ are at $(0,0)$, $(2,5)$ and $(-3,1)$ respectively. If $'+ora+'OA}=\\mathbf{a}$ and $'+ora+'OB}=\\mathbf{b}$, find the coordinates of the points $P$ and $Q$ such that $'+ora+'OP}=2\\mathbf{b}-\\mathbf{a}$ and $'+ora+'OQ}=\\frac{1}{2}\\mathbf{a}-\\mathbf{b}$'+k+'Coordinates of $P=(-8,-3)$\\\\Coordinates of $Q=(4,1\\frac{1}{2})$','In the triangle $OAB$, $M$ is the midpoint of $AB$ and $N$ lies on $OB$ such that $ON$ : $OB=3$ : 4. If $'+ora+'OA}=\\mathbf{a}$ and $'+ora+'OB}=\\mathbf{b}$, express $'+ora+'AB}$, $'+ora+'AM}$, $'+ora+'OM}$ and $'+ora+'OB}$ in terms of $\\mathbf{a}$ and/or $\\mathbf{b}$'+k+'$'+ora+'AB}='+ora+'OB}-'+ora+'OA}=\\mathbf{b}-\\mathbf{a}$\\\\$'+ora+'AM}=\\frac{1}{2}'+ora+'AB}=\\frac{1}{2}(\\mathbf{b}-\\mathbf{a})$\\\\$'+ora+'OM}='+ora+'OA}+'+ora+'AM}=\\frac{1}{2}(\\mathbf{a}+\\mathbf{b})$\\\\$'+ora+'MN}='+ora+'ON}-'+ora+'OM}=\\frac{3}{4}\\mathbf{b}-\\frac{1}{2}(\\mathbf{a}+\\mathbf{b})=\\frac{1}{4}\\mathbf{b}-\\frac{1}{2}\\mathbf{a}$',['Ahmad','Amelia','Aqil','Ava','Emily','George','Harry','Isabella','Isla','Jack','Jacob','Jessica','Jia Ming','Meilin','Shu Chuan','Shu Hui','Thomas','Umar','Wen Tsiong'][a*19|0]+' constructs a parallelogram, $ABCD$. In $ABCD$, $\\angle BAD$ is acute, $'+ora+'AB}=\\mathbf{b}$, $'+ora+'AD}=\\mathbf{d}$, $X$ is the midpoint of $BC$ and $Y$ lies on $DC$ such that $DY=2CY$. Express $'+ora+'AC}$, $'+ora+'BX}$, $'+ora+'AX}$, $'+ora+'DY}$, $'+ora+'AY}$ and $'+ora+'XY}$ in terms of $\\mathbf{b}$ and/or $\\mathbf{d}$'+k+'$'+ora+'AC}='+ora+'AD}+'+ora+'DC}='+ora+'AD}+'+ora+'AB}=\\mathbf{d}+\\mathbf{b}=\\mathbf{b}+\\mathbf{d}$\\\\$'+ora+'BX}=\\frac{1}{2}'+ora+'BC}=\\frac{1}{2}'+ora+'AD}=\\frac{1}{2}\\mathbf{d}$\\\\$'+ora+'AX}='+ora+'AB}+'+ora+'BX}=\\mathbf{b}+\\frac{1}{2}\\mathbf{d}=\\frac{1}{2}(2\\mathbf{b}+\\mathbf{d})$\\\\$'+ora+'DY}=\\frac{2}{2+1}'+ora+'DC}=\\frac{2}{3}'+ora+'DC}=\\frac{2}{3}'+ora+'AB}=\\frac{2}{3}\\mathbf{b}$\\\\$'+ora+'AY}='+ora+'AD}+'+ora+'DY}=\\mathbf{d}+\\frac{2}{3}\\mathbf{b}$\\\\$'+ora+'XY}='+ora+'XA}+'+ora+'AY}=-'+ora+'AX}+'+ora+'AY}=\\frac{1}{2}(2\\mathbf{b}+\\mathbf{d})+\\mathbf{d}+\\frac{2}{3}\\mathbf{b}=\\frac{1}{2}\\mathbf{d}-\\frac{1}{3}\\mathbf{b}$',['Ahmad','Amelia','Aqil','Ava','Emily','George','Harry','Isabella','Isla','Jack','Jacob','Jessica','Jia Ming','Meilin','Shu Chuan','Shu Hui','Thomas','Umar','Wen Tsiong'][a*19|0]+' constructs a parallelogram, $ABCD$. In $ABCD$, $\\angle BAD$ is acute. If $E$ is the midpoint of $BC$ and $F$ that of $DC$, prove that $'+ora+'AE}+'+ora+'AF}=\\frac{3}{2}'+ora+'AC}$'+k+'$'+ora+'AF}='+ora+'AD}+'+ora+'DF}='+ora+'AD}+\\frac{1}{2}'+ora+'DC}='+ora+'AD}+\\frac{1}{2}'+ora+'AB}$\\\\$'+ora+'AE}='+ora+'AB}+'+ora+'BE}='+ora+'AB}+\\frac{1}{2}'+ora+'BC}='+ora+'AB}+\\frac{1}{2}'+ora+'AD}$\\\\$\\therefore'+ora+'AE}+'+ora+'AF}='+ora+'AB}+\\frac{1}{2}'+ora+'AD}+'+ora+'AD}+\\frac{1}{2}'+ora+'AB}=1\\frac{1}{2}('+ora+'AB}'+ora+'AD})=1\\frac{1}{2}('+ora+'AB}+'+ora+'BC})=\\frac{3}{2}('+ora+'AB}+'+ora+'BC})=\\frac{3}{2}'+ora+'AC}$\\\\QED','In the parallelogram $OPQR$, $\\angle POR$ is acute. If $'+ora+'OP}=\\mathbf{p}$, $'+ora+'OR}=\\mathbf{r}$ and $L$ is a point on $OP$ such that $OL=3LP$, express $'+ora+'OQ}$, $'+ora+'OL}$ and $'+ora+'RL}$ in terms of $\\mathbf{p}$ and/or $\\mathbf{r}$'+k+'$'+ora+'OQ}='+ora+'OR}+'+ora+'RQ}='+ora+'OR}+'+ora+'OP}=\\mathbf{r}+\\mathbf{p}=\\mathbf{p}+\\mathbf{r}$\\\\$'+ora+'OL}=\\frac{3}{3+1}'+ora+'OP}=\\frac{3}{4}'+ora+'OP}=\\frac{3}{4}\\mathbf{p}$\\\\$'+ora+'OR}+'+ora+'RL}='+ora+'OL}\\therefore'+ora+'RL}='+ora+'OL}-'+ora+'OR}=\\frac{3}{4}\\mathbf{p}-\\mathbf{r}$','In the parallelogram $OPQR$, $\\angle POR$ is acute. If $'+ora+'OP}=\\mathbf{p}$, $'+ora+'OR}=\\mathbf{r}$ and $L$ is a point on $OP$ such that $OL=3LP$, express $'+ora+'OM}$, in terms of $\\mathbf{p}$, $\\mathbf{r}$ and $k$ given that $'+ora+'RM}=k'+ora+'RL}$'+k+'$'+ora+'OL}=\\frac{3}{3+1}'+ora+'OP}=\\frac{3}{4}'+ora+'OP}=\\frac{3}{4}\\mathbf{p}$\\\\$'+ora+'OR}+'+ora+'RL}='+ora+'OL}\\therefore'+ora+'RL}='+ora+'OL}-'+ora+'OR}=\\frac{3}{4}\\mathbf{p}-\\mathbf{r}$\\\\$'+ora+'OM}='+ora+'OR}+'+ora+'RM}=\\mathbf{r}+k'+ora+'RL}=\\mathbf{r}+k(\\frac{3}{4}\\mathbf{p}-\\mathbf{r})$','In $\\Delta OPQ$, $'+ora+'OP}=3\\mathbf{p}$, $'+ora+'OQ}=2\\mathbf{q}$ and $OB=\\frac{2}{3}OP$. $A$ is the midpoint of $OQ$, $AR=\\frac{1}{3}AB$ and $\\frac{QS}{SP}=\\frac{2}{3}$. Express $'+ora+'AB}$, $'+ora+'AR}$, $'+ora+'OR}$, $'+ora+'QS}$ and $'+ora+'OS}$ as simply as is possible and in terms of $\\mathbf{p}$ and/or $\\mathbf{q}$'+k+'$'+ora+'OA}+'+ora+'AB}='+ora+'OB}\\therefore'+ora+'AB}='+ora+'OB}-'+ora+'OA}=\\frac{2}{3}'+ora+'OP}-\\frac{1}{2}'+ora+'OQ}=\\frac{2}{3}(3\\mathbf{p})-\\frac{1}{2}(2\\mathbf{q})=2\\mathbf{p}-\\mathbf{q}$\\\\$'+ora+'AR}=\\frac{1}{3}'+ora+'AB}=\\frac{1}{3}(2\\mathbf{p}-\\mathbf{q})$\\\\$'+ora+'OR}='+ora+'OA}+'+ora+'AR}=\\frac{1}{2}'+ora+'OQ}+\\frac{1}{3}(2\\mathbf{p}-\\mathbf{q})=\\frac{1}{2}(2\\mathbf{q})+\\frac{1}{3}(2\\mathbf{p}-\\mathbf{q})=\\frac{2}{3}\\mathbf{p}+\\frac{2}{3}\\mathbf{q}=\\frac{2}{3}(\\mathbf{p}+\\mathbf{q})$\\\\$'+ora+'OQ}+'+ora+'QP}='+ora+'OP}\\therefore'+ora+'QP}='+ora+'OP}-'+ora+'OQ}=3\\mathbf{p}-2\\mathbf{q}$\\\\$\\frac{QS}{SP}=\\frac{2}{3}\\therefore\\frac{QS}{QP-QS}=\\frac{2}{3}\\therefore3QS=2QP-2QS\\therefore5QS=2QP\\therefore QS=\\frac{2QP}{3}=\\frac{2}{5}QP\\therefore'+ora+'QS}=\\frac{2}{5}(3\\mathbf{p}-2\\mathbf{q})$\\\\$'+ora+'OS}='+ora+'OQ}+'+ora+'QS}=2\\mathbf{q}+\\frac{2}{5}(3\\mathbf{p}-2\\mathbf{q})=\\frac{6}{5}\\mathbf{q}+\\frac{6}{5}\\mathbf{p}=\\frac{6}{5}(\\mathbf{q}+\\mathbf{p})=1\\frac{1}{5}(\\mathbf{p}+\\mathbf{q})$','In $\\Delta OAB$, $X$ lies on $OA$, $OX=\\frac{1}{3}OA$, $'+ora+'OA}=\\mathbf{a}$, $'+ora+'OB}=\\mathbf{b}$, $P$ lies on $BX$ and $'+ora+'OP}=\\frac{1}{5}\\mathbf{a}+\\frac{2}{5}\\mathbf{b}$. Find $'+ora+'BX}$ and $'+ora+'BP}$ in terms of $\\mathbf{a}$ and $\\mathbf{b}$ and given that $'+ora+'BP}=k'+ora+'BX}$, find $k$. Find hence the numerical value of $\\frac{BP}{PX}$'+k+'$'+ora+'OB}+'+ora+'BX}='+ora+'OX}\\therefore'+ora+'BX}='+ora+'OX}-'+ora+'OB}=\\frac{1}{3}'+ora+'OA}-'+ora+'OB}=\\frac{1}{3}\\mathbf{a}-\\mathbf{b}$\\\\$'+ora+'OB}+'+ora+'BP}='+ora+'OP}=\\frac{1}{5}\\mathbf{a}+\\frac{2}{5}\\mathbf{b}\\therefore\\mathbf{b}+'+ora+'BP}=\\frac{1}{5}\\mathbf{a}+\\frac{2}{5}\\mathbf{b}\\therefore'+ora+'BP}=\\frac{1}{5}\\mathbf{a}+\\frac{2}{5}\\mathbf{b}-\\mathbf{b}=\\frac{1}{5}\\mathbf{a}-\\frac{3}{5}\\mathbf{b}=\\frac{1}{5}(\\mathbf{a}-3\\mathbf{b})$\\\\$'+ora+'BP}=k'+ora+'BX}\\therefore\\frac{1}{5}(\\mathbf{a}-3\\mathbf{b})=k(\\frac{1}{3}\\mathbf{a}-\\mathbf{b})\\therefore\\frac{1}{5}(3)(\\frac{1}{3}\\mathbf{a}-\\mathbf{b})=k(\\frac{1}{3}\\mathbf{a}-\\mathbf{b})$\\\\$\\therefore\\frac{3}{5}(\\frac{1}{3}\\mathbf{a}-\\mathbf{b})=k(\\frac{1}{3}\\mathbf{a}-\\mathbf{b})$\\\\$\\therefore\\frac{3}{5}=k$\\\\$\\therefore k=\\frac{3}{5}$\\\\$'+ora+'BP}+'+ora+'PX}='+ora+'BX}$------(1)\\\\$'+ora+'BP}=k'+ora+'BX}$\\\\From above calculations:\\\\$k=\\frac{3}{5}$\\\\$\\therefore'+ora+'BP}=\\frac{3}{5}'+ora+'BX}$\\\\$\\therefore\\frac{3}{5}'+ora+'BX}='+ora+'BP}$\\\\$'+ora+'BX}=\\frac{5}{3}'+ora+'BP}$------(2)\\\\Substituting (2) into (1):\\\\$'+ora+'BP}+'+ora+'PX}=\\frac{5}{3}'+ora+'BP}$\\\\$'+ora+'PX}=\\frac{2}{3}'+ora+'BP}$\\\\$\\therefore PX=\\frac{2}{3}BP$\\\\$\\therefore\\frac{BP}{PX}=\\frac{BP}{\\frac{2}{3}BP}=\\frac{1}{\\frac{2}{3}}=\\frac{3}{2}$','On a coordinate grid, $O$, $A$, $B$ and $C$ are at $(0,0)$, $(-7,5)$, $(5,5)$ and $(-6,-5)$ respectively. State the position vectors of the latter three points with respect to $O$'+k+'$'+ora+'OA}=\\begin{pmatrix}-7\\\\5\\end{pmatrix}$\\\\$'+ora+'OB}=\\begin{pmatrix}5\\\\5\\end{pmatrix}$\\\\$'+ora+'OC}=\\begin{pmatrix}-6\\\\-5\\end{pmatrix}$','On a coordinate grid, $O$, $A$, $B$ and $C$ are at $(0,0)$, $(-7,5)$, $(5,5)$ and $(-6,-5)$ respectively. State the column vector for $'+ora+'CA}$'+k+'$'+ora+'OA}=\\begin{pmatrix}-7\\\\5\\end{pmatrix}$--------(1)\\\\$'+ora+'OC}=\\begin{pmatrix}-6\\\\-5\\end{pmatrix}$--------(2)\\\\$'+ora+'OA}+'+ora+'AC}='+ora+'OC}$\\\\$\\therefore'+ora+'AC}='+ora+'OC}-'+ora+'OA}$\\\\$\\therefore'+ora+'CA}='+ora+'OA}-'+ora+'OC}$--------(3)\\\\Substituting (1) and (2) into (3):\\\\$'+ora+'CA}=\\begin{pmatrix}-7\\\\5\\end{pmatrix}-\\begin{pmatrix}-6\\\\-5\\end{pmatrix}=\\begin{pmatrix}-7-(-6)\\\\5-(-5)\\end{pmatrix}=\\begin{pmatrix}-1\\\\10\\end{pmatrix}$','On a coordinate grid, $O$, $A$, $B$ and $C$ are at $(0,0)$, $(-7,5)$, $(5,5)$ and $(-6,-5)$ respectively. Find $|'+ora+'CA}|$'+k+'$'+ora+'OA}=\\begin{pmatrix}-7\\\\5\\end{pmatrix}$--------(1)\\\\$'+ora+'OC}=\\begin{pmatrix}-6\\\\-5\\end{pmatrix}$--------(2)\\\\$'+ora+'OA}+'+ora+'AC}='+ora+'OC}$\\\\$\\therefore'+ora+'AC}='+ora+'OC}-'+ora+'OA}$\\\\$\\therefore'+ora+'CA}='+ora+'OA}-'+ora+'OC}$--------(3)\\\\Substituting (1) and (2) into (3):\\\\$'+ora+'CA}=\\begin{pmatrix}-7\\\\5\\end{pmatrix}-\\begin{pmatrix}-6\\\\-5\\end{pmatrix}=\\begin{pmatrix}-7-(-6)\\\\5-(-5)\\end{pmatrix}=\\begin{pmatrix}-1\\\\10\\end{pmatrix}$\\\\$\\therefore|'+ora+'CA}|=\\sqrt{(-1)^2+10^2}=\\sqrt{101}$ u','If $R$ is at $(5,6)$, $S$ is at $(-1,2)$, $XY\\parallelslant RS$ and $'+ora+'XY}=\\begin{pmatrix}7.5\\\\k\\end{pmatrix}$, find $k$'+k+'The coordinates of $R$ are $(5,6)$ and those of $S$ are $(-1,2)$\\\\$\\therefore'+ora+'OR}=\\begin{pmatrix}5\\\\6\\end{pmatrix}$------(1),$'+ora+'OS}=\\begin{pmatrix}-1\\\\2\\end{pmatrix}$------(2)\\\\$'+ora+'OR}+'+ora+'RS}='+ora+'OS}$\\\\$\\therefore'+ora+'RS}='+ora+'OS}-'+ora+'OR}$------(3)\\\\Substituting (1) and (2) into (3):\\\\$'+ora+'RS}=\\begin{pmatrix}-1\\\\2\\end{pmatrix}\\begin{pmatrix}5\\\\6\\end{pmatrix}=\\begin{pmatrix}-1-5\\\\2-6\\end{pmatrix}=\\begin{pmatrix}-6\\\\-4\\end{pmatrix}$------(4)\\\\$XY\\parallelslant RS\\therefore'+ora+'XY}$ is parallel to $'+ora+'RS}$\\\\$\\therefore'+ora+'XY}=m'+ora+'RS}$------(5)\\\\$'+ora+'XY}=\\begin{pmatrix}7.5\\\\k\\end{pmatrix}$\\\\$\\therefore\\begin{pmatrix}7.5\\\\k\\end{pmatrix}='+ora+'XY}$------(6)\\\\Substituting (4) into (5):\\\\$'+ora+'XY}=m\\begin{pmatrix}-6\\\\-4\\end{pmatrix}$------(7)\\\\Substituting (7) into (6):\\\\$\\begin{pmatrix}7.5\\\\k\\end{pmatrix}=m\\begin{pmatrix}-6\\\\-4\\end{pmatrix}=\\begin{pmatrix}m(-6)\\\\(-4)\\end{pmatrix}=\\begin{pmatrix}-6m\\\\-4m\\end{pmatrix}$\\\\The corresponding elements of $\\begin{pmatrix}7.5\\\\k\\end{pmatrix}$ and $\\begin{pmatrix}-6m\\\\-4m\\end{pmatrix}$ are equal,\\\\$\\therefore$\\\\\\[\\systeme*{7.5=-6m\\text{------(8)},k=-4m\\text{------(9)}}\\]\\\\From (8):\\\\$-6m=7.5$\\\\$m=\\frac{7.5}{-6}=-1.25$------(10)\\\\Substituting (10) into (9):\\\\$k=-4(-1.25)=5$','If $T$ is the translation $\\begin{pmatrix}2\\\\4\\end{pmatrix}$ and $A$ is at $(2,4)$, find the coordinates of the image of $A$ under $T$'+k+"The coordinates of $A$ are $(2,4)$\\\\$\\therefore A'=T(A)=\\begin{pmatrix}2\\\\4\\end{pmatrix}+\\begin{pmatrix}2\\\\4\\end{pmatrix}=\\begin{pmatrix}2+2\\\\4+4\\end{pmatrix}=\\begin{pmatrix}4\\\\8\\end{pmatrix}$\\\\$\\therefore$image of $A$ under $T$ is $(4,8)$.",'If $T$ is the translation $\\begin{pmatrix}2\\\\4\\end{pmatrix}$ and $A$ is at $(2,4)$, find the coordinates of the point $D$ such that $T^2(D)=A$'+k+'Let $(x,y)=$coordinates of $D$\\\\$\\therefore$\\\\$T^2(D)=A$\\\\$\\begin{pmatrix}2\\\\4\\end{pmatrix}+\\begin{pmatrix}2\\\\4\\end{pmatrix}+\\begin{pmatrix}x\\\\y\\end{pmatrix}=\\begin{pmatrix}2\\\\4\\end{pmatrix}$\\\\$\\begin{pmatrix}2+2+x\\\\4+4+y\\end{pmatrix}=\\begin{pmatrix}2\\\\4\\end{pmatrix}$\\\\$\\begin{pmatrix}x+4\\\\y+8\\end{pmatrix}=\\begin{pmatrix}2\\\\4\\end{pmatrix}$\\\\The corresponding elements of $\\begin{pmatrix}x+4\\\\y+8\\end{pmatrix}$ and $\\begin{pmatrix}2\\\\4\\end{pmatrix}$ are equal,\\\\$\\therefore$\\\\\\[\\systeme*{x+4=2\\text{------(1)},y+8=4\\text{------(2)}}\\]\\\\From (1):\\\\$x=-2$\\\\From (2):\\\\$y=-4$\\\\$\\therefore$coordinates of $D=(-2,-4)$'][a*15|0]).replace('','')}down(alle.slice(6))}

